import React from 'react';

let Users = (props) => {
    return (
        <section>
            <h2>{props.h}</h2>
            <ul>
                {props.users.map(u => <li key={u.id}>
                    <span>
                        <img src={u.photoUrl}/>
                        <button>Follow</button>
                    </span>
                    <span>
                        <b>{u.fullName}</b>
                        <p>{u.status}</p>
                        <span>{u.location.city}</span>
                        <span>{u.location.country}</span>
                    </span>
                </li>)}
            </ul>
        </section>
    )
}

export default Users;
